import './App.css';
import Intro from './components/Intro';
import Projects from './components/Projects';
import Experience from './components/Experience';
import Fun from './components/Fun';
import Nav from './components/Nav';

function App() {
  return (
    <div className="App">
      <Nav/>
      <Intro/>
      <Projects/>
      <Experience/>
      <Fun/>
    </div>
  );
}

export default App;
